import CardItem from './CardItem';
import './Cards.css'

function Cards() {
  return (
    <div className='cards'>
        <h1>Confira estas promoções!</h1>
        <div class="cards__container">
            <div class="cards__wrapper">
                <ul class="cards__items">
                <CardsItem />
                </ul>
            </div>
        </div>
    </div>
  );
}

export default Cards;
